import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 8.2A-104 Leases subject to other law.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/8.2A-104.md","filePath":"vacode/8.2A-104.md"}'),o={name:"vacode/8.2A-104.md"},i=r('<h1 id="§-8-2a-104-leases-subject-to-other-law" tabindex="-1">§ 8.2A-104 Leases subject to other law. <a class="header-anchor" href="#§-8-2a-104-leases-subject-to-other-law" aria-label="Permalink to &quot;§ 8.2A-104 Leases subject to other law.&quot;">​</a></h1><p>(1) A lease, although subject to this title, is also subject to any applicable:</p><p>(a) Certificate of title statute of this Commonwealth such as Article 2 (§ <a href="http://law.lis.virginia.gov/vacode/46.2-616/" target="_blank" rel="noreferrer">46.2-616</a> et seq.) of Chapter 6 of Title 46.2 and Article 2.1 (§ <a href="http://law.lis.virginia.gov/vacode/29.1-733.2/" target="_blank" rel="noreferrer">29.1-733.2</a> et seq.) of Chapter 7 of Title 29.1;</p><p>(b) Certificate of title statute of another jurisdiction (§ <a href="http://law.lis.virginia.gov/vacode/8.2A-105/" target="_blank" rel="noreferrer">8.2A-105</a>); or</p><p>(c) Consumer protection statute of this Commonwealth, such as Chapter 17 (§ <a href="http://law.lis.virginia.gov/vacode/59.1-196/" target="_blank" rel="noreferrer">59.1-196</a> et seq.) of Title 59.1, or final consumer protection decision of a court of this Commonwealth existing on the effective date of this title.</p><p>(2) In case of conflict between this title, other than §§ <a href="http://law.lis.virginia.gov/vacode/8.2A-105/" target="_blank" rel="noreferrer">8.2A-105</a>, <a href="http://law.lis.virginia.gov/vacode/8.2A-304/" target="_blank" rel="noreferrer">8.2A-304</a> (3) and <a href="http://law.lis.virginia.gov/vacode/8.2A-305/" target="_blank" rel="noreferrer">8.2A-305</a> (3), and a statute or decision referred to in subsection (1) of this section, the statute or decision controls.</p><p>(3) Failure to comply with an applicable law has only the effect specified therein.</p><p>1991, c. 536; 2013, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0787" target="_blank" rel="noreferrer">787</a>.</p>',8),s=[i];function l(n,c,h,f,p,_){return t(),a("div",null,s)}const u=e(o,[["render",l]]);export{g as __pageData,u as default};
